"On ne peut pas rester 10 ans sur un territoire comme le #Mali. On doit avoir des opérations pompier, pour la sécurité de l'#Europe. Mais ces opérations doivent s'arrêter à un moment et il faut responsabiliser ces pays."
@dupontaignan

#Presidentielle2022 #cdanslair https://t.co/DxwIpUBDV6

"Au #Mali, la présence européenne ne veut rien dire, c'est un fiasco intégral. Je ne crois qu'aux relations bilatérales."
@dupontaignan

#Presidentielle2022 #cdanslair #Takuba #Sahel https://t.co/9iBnNrk9yl

"Il ne s'agit pas d'être seuls. Je ne veux pas exclure le syndic qu'est l'#Europe, mais le remettre à sa place. Il doit s'occuper des parties communes mais pas de la vie des nations, de leur démocratie, leur quotidien."
@dupontaignan

#Presidentielle2022 #cdanslair #Politique https://t.co/Le3mBACR8h

"Soit il y a une refonte, soit on s'en ira comme les Anglais, ce que je ne souhaite pas. Cette #Europe ne nous prépare pas aux défis du monde : la maîtrise des technologies, la #politique vis à vis de l'#Afrique, l'#environnement."
@dupontaignan

#Presidentielle2022 #cdanslair https://t.co/IXpzaFFgQR

"Si on continue comme ça avec une #Europe qui nous coûte très cher, qui n'est pas élue, d'autres pays vont partir. Il y a déjà eu le #Brexit. On doit sortir de l'impuissance européenne et se concentrer sur quelques objectifs."
@dupontaignan

#Presidentielle2022 #cdanslair https://t.co/GOuiTYuFb8

